import React from "react";
import "./chefsFilters.css";

const ChefsFilters:React.FC = ()=>{
    return(
        <div id="chefs-filter-container">
            <button>All</button>
            <button>New</button>
            <button>Most Viewed</button>
        </div>
    )
}

export default ChefsFilters;
